import React from 'react'
import { Form } from 'react-bootstrap'

const TodoForm = () => {
  return (
    <Form.Group className="mb-3" controlId="formBasicEmail">
    <Form.Control type="email" placeholder="Enter email" />
  </Form.Group>
  )
}

export default TodoForm
